'''''Amon Hen'' 6''' is the sixth issue of the [[Amon Hen (journal)|''Amon Hen'' journal]] by [[The Tolkien Society]], the last one to be edited by John Martin. Due to an upcoming marriage, relocation, and change of job, Martin was unable to assemble the materials that he had collected, and the issue consisted solely of an editorial note stating that Martin had not been informed who the new editor would be, followed by a list of Tolkien Society members.
